import logo from "./logo.svg";
import "./App.css";
import React, { Component } from "react";

class Head extends Component {
  render() {
    return (
      <header>
        <h1>Hello</h1>
      </header>
    );
  }
}

class App extends Component {
  render() {
    return <div className="App"></div>;
  }
}

export default App;
